INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 0, "カリン", 1, 60000, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 1, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 1, "", 1, 60000, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 1, "", 1, 60000, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 1, "", 2, 60000, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (5, 2, "", 1, 60000, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (6, 2, "", 1, 60000, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (7, 2, "", 2, 60000, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (8, 3, "", 1, 60000, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (9, 3, "", 1, 60000, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (10, 3, "", 1, 60000, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (11, 3, "", 1, 60000, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (12, 3, "", 2, 60000, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (13, 4, "", 1, 60000, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (14, 4, "", 1, 60000, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (15, 4, "", 1, 60000, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (16, 4, "", 1, 60000, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (17, 4, "", 2, 60000, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (18, 0, "カリン", 0, 60000, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 0, "", 2, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (19, 0, "カリン", 0, 60000, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, 0, "", 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (20, 0, "ハツネ", 0, 80001, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 1, 0, "", 1, 101201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (21, 0, "ハツネ", 0, 80001, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 1, 0, "", 2, 101201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (22, 0, "シオリ", 0, 80001, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 1, 0, "", 1, 103801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (23, 0, "シオリ", 0, 80001, "来年も、\n一緒にいられたら…\nうれしいな", 1, 1, 0, "", 2, 103801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (24, 0, "キョウカ", 0, 80001, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 2, 0, "", 1, 103601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (25, 0, "キョウカ", 0, 80001, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 2, 0, "", 2, 103601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (26, 0, "ミミ", 0, 80001, "おにいちゃんとあってから、\n1年たったよ～！", 1, 2, 0, "", 1, 102001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (27, 0, "ミミ", 0, 80001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 1, 2, 0, "", 2, 102001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (28, 0, "ミソギ", 0, 80001, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 2, 0, "", 1, 100401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (29, 0, "ミソギ", 0, 80001, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 2, 0, "", 2, 100401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (30, 0, "マホ", 0, 80001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 3, 0, "", 1, 101001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (31, 0, "マホ", 0, 80001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 3, 0, "", 2, 101001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (32, 0, "イリヤ", 0, 80001, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 3, 0, "", 1, 104401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (33, 0, "イリヤ", 0, 80001, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 1, 3, 0, "", 2, 104401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (34, 0, "カオリ", 0, 80001, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 2, 3, 0, "", 1, 101701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (35, 0, "カオリ", 0, 80001, "これからも、どうぞよろしく\nお願いするさ～！", 2, 3, 0, "", 2, 101701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (36, 0, "サレン", 0, 80001, "あんたと出会ってからもうそんなに\nたつのね～", 0, 4, 0, "", 1, 102801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (37, 0, "サレン", 0, 80001, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 4, 0, "", 2, 102801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (38, 0, "スズメ", 0, 80001, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 4, 0, "", 1, 102501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (39, 0, "スズメ", 0, 80001, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 1, 4, 0, "", 2, 102501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (40, 0, "タマキ", 0, 80001, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 5, 0, "", 1, 104601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (41, 0, "タマキ", 0, 80001, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 5, 0, "", 2, 104601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (42, 0, "ミフユ", 0, 80001, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 5, 0, "", 1, 104801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (43, 0, "ミフユ", 0, 80001, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 1, 5, 0, "", 2, 104801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (44, 0, "アキノ", 0, 80001, "あなたさまと出会ってもう1年…", 0, 6, 0, "", 1, 103201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (45, 0, "アキノ", 0, 80001, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 6, 0, "", 2, 103201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (46, 0, "ユカリ", 0, 80001, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 6, 0, "", 1, 103401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (47, 0, "ユカリ", 0, 80001, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 1, 6, 0, "", 2, 103401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (48, 0, "クリスティーナ", 0, 80001, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 7, 0, "", 1, 107101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (49, 0, "クリスティーナ", 0, 80001, "ともかくこれからも\n愉しませてくれよ☆", 0, 7, 0, "", 2, 107101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (50, 0, "ジュン", 0, 80001, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 7, 0, "", 1, 104701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (51, 0, "ジュン", 0, 80001, "見えないから分からないって？\nそれもそうだな…", 1, 7, 0, "", 2, 104701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (52, 0, "トモ", 0, 80001, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 8, 0, "", 1, 103701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (53, 0, "トモ", 0, 80001, "これからもよろしくね！", 0, 8, 0, "", 2, 103701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (54, 0, "マツリ", 0, 80001, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 8, 0, "", 1, 100501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (55, 0, "マツリ", 0, 80001, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 1, 8, 0, "", 2, 100501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (56, 0, "ミヤコ", 0, 80001, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 9, 0, "", 1, 100701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (57, 0, "ミヤコ", 0, 80001, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 9, 0, "", 2, 100701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (58, 0, "シノブ", 0, 80001, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 9, 0, "", 1, 103101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (59, 0, "シノブ", 0, 80001, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 1, 9, 0, "", 2, 103101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (60, 0, "アンナ", 0, 80001, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 10, 0, "", 1, 100901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (61, 0, "アンナ", 0, 80001, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 10, 0, "", 2, 100901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (62, 0, "ナナカ", 0, 80001, "君と出会ってもう1年だって！\n早いねー！", 1, 10, 0, "", 1, 101301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (63, 0, "ナナカ", 0, 80001, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 1, 10, 0, "", 2, 101301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (64, 0, "ミツキ", 0, 80001, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 11, 0, "", 1, 105101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (65, 0, "ミツキ", 0, 80001, "これからも、いろんなところを\n調べさせてね？", 0, 11, 0, "", 2, 105101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (66, 0, "ルカ", 0, 80001, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 11, 0, "", 1, 105601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (67, 0, "ルカ", 0, 80001, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 1, 11, 0, "", 2, 105601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (68, 0, "エリコ", 0, 80001, "早いものですわね、あなた様と\nお会いして、もう1年…", 2, 11, 0, "", 1, 102701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (69, 0, "エリコ", 0, 80001, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 11, 0, "", 2, 102701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (70, 0, "アヤネ", 0, 80001, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 12, 0, "", 1, 102301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (71, 0, "アヤネ", 0, 80001, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 12, 0, "", 2, 102301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (72, 0, "チカ", 0, 80001, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 12, 0, "", 1, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (73, 0, "チカ", 0, 80001, "私のことを見守ってください\nできることなら、ずっと…", 1, 12, 0, "", 2, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (74, 0, "クルミ", 0, 80001, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 2, 12, 0, "", 1, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (75, 0, "クルミ", 0, 80001, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 12, 0, "", 2, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (76, 0, "シズル", 0, 80001, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 13, 0, "", 1, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (77, 0, "シズル", 0, 80001, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 13, 0, "", 2, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (78, 0, "リノ", 0, 80001, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 13, 0, "", 1, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (79, 0, "リノ", 0, 80001, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 1, 13, 0, "", 2, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (80, 0, "ユイ", 0, 80001, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 14, 0, "", 1, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (81, 0, "ユイ", 0, 80001, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 14, 0, "", 2, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (82, 0, "ヒヨリ", 0, 80001, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 14, 0, "", 1, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (83, 0, "ヒヨリ", 0, 80001, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 1, 14, 0, "", 2, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (84, 0, "レイ", 0, 80001, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 2, 14, 0, "", 1, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (85, 0, "レイ", 0, 80001, "キミに背中を預けられる日が、\n早くきますように", 2, 14, 0, "", 2, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (86, 0, "ペコリーヌ", 0, 80001, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 15, 0, "", 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (87, 0, "ペコリーヌ", 0, 80001, "これからもずっと、覚えていて\nくださいね！", 0, 15, 0, "", 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (88, 0, "コッコロ", 0, 80001, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 15, 0, "", 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (89, 0, "コッコロ", 0, 80001, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 1, 15, 0, "", 2, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (90, 0, "キャル", 0, 80001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 2, 15, 0, "", 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (91, 0, "キャル", 0, 80001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 15, 0, "", 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (92, 0, "スズメ", 1, 60001, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, 0, "", 1, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (93, 1, "", 1, 60001, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (94, 1, "", 1, 60001, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (95, 1, "", 1, 60001, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (96, 1, "", 1, 60001, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (97, 1, "", 2, 60001, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (98, 2, "", 1, 60001, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (99, 2, "", 1, 60001, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (100, 2, "", 1, 60001, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (101, 2, "", 1, 60001, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (102, 2, "", 2, 60001, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (103, 3, "", 1, 60001, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (104, 3, "", 1, 60001, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (105, 3, "", 1, 60001, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (106, 3, "", 1, 60001, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (107, 3, "", 1, 60001, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (108, 3, "", 1, 60001, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (109, 3, "", 2, 60001, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (110, 4, "", 1, 60001, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (111, 4, "", 1, 60001, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (112, 4, "", 1, 60001, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (113, 4, "", 1, 60001, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (114, 4, "", 1, 60001, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (115, 4, "", 1, 60001, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (116, 4, "", 2, 60001, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (117, 0, "スズメ", 0, 60001, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 3, 0, 0, "", 2, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (118, 0, "スズメ", 0, 60001, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 7, 0, "", 3, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (119, 0, "ペコリーヌ", 0, 80003, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 1, 0, "", 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (120, 0, "コッコロ", 0, 80003, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 1, 0, "", 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (121, 0, "コッコロ", 0, 80003, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 1, 0, "", 2, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (122, 0, "キャル", 0, 80003, "え？　ちょっと\nいきなりなにっ？", 2, 1, 0, "", 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (123, 0, "キャル", 0, 80003, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 1, 0, "", 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (124, 0, "ペコリーヌ", 0, 80003, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 1, 0, "", 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (125, 0, "ペコリーヌ", 0, 80003, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 1, 0, "", 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (126, 0, "コッコロ", 0, 80003, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 1, 0, "", 3, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (127, 0, "キャル", 0, 80003, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 2, 1, 0, "", 3, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (128, 0, "コッコロ", 0, 80003, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 1, 0, "", 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (129, 0, "ペコリーヌ", 0, 80003, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 1, 0, "", 4, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (130, 0, "キャル", 0, 80003, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 2, 1, 0, "", 4, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (131, 0, "コッコロ", 0, 80003, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 1, 0, "", 5, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (132, 0, "キャル", 0, 80003, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 2, 0, "", 5, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (133, 0, "カリン", 0, 80003, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 2, 0, "", 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (134, 0, "キャル", 0, 80003, "げっ…カリンじゃない\nなんでもないわよ！", 0, 2, 0, "", 6, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (135, 0, "カリン", 0, 80003, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 1, 2, 0, "", 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (136, 0, "キャル", 0, 80003, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 2, 0, "", 7, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (137, 0, "カリン", 0, 80003, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 1, 2, 0, "", 3, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (138, 0, "キャル", 0, 80003, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 2, 0, "", 8, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (139, 0, "キャル", 0, 80003, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 2, 0, "", 9, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (140, 0, "カリン", 0, 80003, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 1, 2, 0, "", 4, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (141, 0, "キャル", 0, 80003, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 2, 0, "", 10, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (142, 0, "カリン", 0, 80003, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 1, 2, 0, "", 5, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (143, 0, "キャル", 0, 80003, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 2, 0, "", 11, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (144, 0, "コッコロ", 0, 80003, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 3, 0, "", 6, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (145, 0, "ペコリーヌ", 0, 80003, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 1, 3, 0, "", 5, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (146, 0, "コッコロ", 0, 80003, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 3, 0, "", 7, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (147, 0, "コッコロ", 0, 80003, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 3, 0, "", 8, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (148, 0, "ペコリーヌ", 0, 80003, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 1, 3, 0, "", 6, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (149, 0, "ペコリーヌ", 0, 80003, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 1, 3, 0, "", 7, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (150, 0, "コッコロ", 0, 80003, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 3, 0, "", 9, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (151, 0, "ペコリーヌ", 0, 80003, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 1, 3, 0, "", 8, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (152, 0, "コッコロ", 0, 80003, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 3, 0, "", 10, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (153, 0, "ペコリーヌ", 0, 80003, "えへへ、ありがとうございます\nコッコロちゃん！", 1, 3, 0, "", 9, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (154, 0, "コッコロ", 0, 80003, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 3, 0, "", 11, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (155, 0, "ペコリーヌ", 0, 80003, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 1, 3, 0, "", 10, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (156, 0, "ペコリーヌ", 0, 80003, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 4, 0, "", 11, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (157, 0, "キャル", 0, 80003, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 1, 4, 0, "", 12, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (158, 0, "ペコリーヌ", 0, 80003, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 4, 0, "", 12, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (159, 0, "キャル", 0, 80003, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 1, 4, 0, "", 13, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (160, 0, "ペコリーヌ", 0, 80003, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 4, 0, "", 13, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (161, 0, "キャル", 0, 80003, "…積極的？\nなんの話よ？", 1, 4, 0, "", 14, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (162, 0, "ペコリーヌ", 0, 80003, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 4, 0, "", 14, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (163, 0, "ペコリーヌ", 0, 80003, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 4, 0, "", 15, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (164, 0, "キャル", 0, 80003, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 1, 4, 0, "", 15, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (165, 0, "ペコリーヌ", 0, 80003, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 4, 0, "", 16, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (166, 0, "キャル", 0, 80003, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 1, 4, 0, "", 16, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (167, 0, "キャル", 0, 80003, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 1, 4, 0, "", 17, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (168, 0, "キャル", 0, 80003, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 5, 0, "", 18, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (169, 0, "コッコロ", 0, 80003, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 1, 5, 0, "", 12, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (170, 0, "キャル", 0, 80003, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 5, 0, "", 19, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (171, 0, "コッコロ", 0, 80003, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 1, 5, 0, "", 13, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (172, 0, "キャル", 0, 80003, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 5, 0, "", 20, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (173, 0, "コッコロ", 0, 80003, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 1, 5, 0, "", 14, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (174, 0, "キャル", 0, 80003, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 5, 0, "", 21, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (175, 0, "コッコロ", 0, 80003, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 1, 5, 0, "", 15, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (176, 0, "キャル", 0, 80003, "かくし芸？", 0, 5, 0, "", 22, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (177, 0, "コッコロ", 0, 80003, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 1, 5, 0, "", 16, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (178, 0, "キャル", 0, 80003, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 5, 0, "", 23, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (179, 0, "ペコリーヌ", 0, 80003, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 6, 0, "", 17, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (180, 0, "キャル", 0, 80003, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 2, 6, 0, "", 24, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (181, 0, "コッコロ", 0, 80003, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 1, 6, 0, "", 17, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (182, 0, "ペコリーヌ", 0, 80003, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 6, 0, "", 18, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (183, 0, "キャル", 0, 80003, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 2, 6, 0, "", 25, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (184, 0, "コッコロ", 0, 80003, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 1, 6, 0, "", 18, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (185, 0, "キャル", 0, 80003, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 2, 6, 0, "", 26, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (186, 0, "キャル", 0, 80003, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 2, 6, 0, "", 27, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (187, 0, "キャル", 0, 80003, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 2, 6, 0, "", 28, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (188, 0, "ペコリーヌ", 0, 80003, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 6, 0, "", 19, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (189, 0, "コッコロ", 0, 80003, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 1, 6, 0, "", 19, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (190, 0, "キャル", 0, 80003, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 2, 6, 0, "", 29, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (191, 0, "キャル", 0, 80003, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 7, 0, "", 30, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (192, 0, "キャル", 0, 80003, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 7, 0, "", 31, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (193, 0, "キャル", 0, 80003, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 7, 0, "", 32, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (194, 0, "キャル", 0, 80003, "あー\nあー\n…声、これで大丈夫かしら？", 0, 7, 0, "", 33, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (195, 0, "キャル", 0, 80003, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 7, 0, "", 34, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (196, 0, "キャル", 0, 80003, "オイッスー☆", 0, 7, 0, "", 35, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (197, 0, "キャル", 0, 80003, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 7, 0, "", 36, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (198, 0, "キャル", 0, 80003, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 7, 0, "", 37, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (199, 0, "キャル", 0, 80003, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 7, 0, "", 38, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (200, 0, "コッコロ", 0, 80003, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 8, 0, "", 20, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (201, 0, "コッコロ", 0, 80003, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 8, 0, "", 21, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (202, 0, "コッコロ", 0, 80003, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 8, 0, "", 22, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (203, 0, "コッコロ", 0, 80003, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 8, 0, "", 23, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (204, 0, "コッコロ", 0, 80003, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 8, 0, "", 24, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (205, 0, "コッコロ", 0, 80003, "オイッスー☆", 0, 8, 0, "", 25, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (206, 0, "コッコロ", 0, 80003, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 8, 0, "", 26, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (207, 0, "コッコロ", 0, 80003, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 8, 0, "", 27, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (208, 0, "コッコロ", 0, 80003, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 8, 0, "", 28, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (209, 0, "ペコリーヌ", 0, 80003, "オイッスー☆", 0, 9, 0, "", 20, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (210, 0, "ペコリーヌ", 0, 80003, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 9, 0, "", 21, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (211, 0, "ペコリーヌ", 0, 80003, "あと６日で2.5周年ですか…", 0, 9, 0, "", 22, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (212, 0, "ペコリーヌ", 0, 80003, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 9, 0, "", 23, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (213, 0, "ペコリーヌ", 0, 80003, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 9, 0, "", 24, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (214, 0, "ペコリーヌ", 0, 80003, "オイッスー☆", 0, 9, 0, "", 25, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (215, 0, "ペコリーヌ", 0, 80003, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 9, 0, "", 26, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (216, 0, "ペコリーヌ", 0, 80003, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 9, 0, "", 27, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (217, 0, "ペコリーヌ", 0, 80003, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 9, 0, "", 28, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (218, 0, "ペコリーヌ", 0, 80003, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 9, 0, "", 29, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (219, 0, "ペコリーヌ", 0, 80003, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 9, 0, "", 30, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (220, 0, "ペコリーヌ", 0, 80003, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 10, 0, "", 31, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (221, 0, "コッコロ", 0, 80003, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 1, 10, 0, "", 29, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (222, 0, "ペコリーヌ", 0, 80003, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 10, 0, "", 32, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (223, 0, "キャル", 0, 80003, "…………", 2, 10, 0, "", 39, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (224, 0, "コッコロ", 0, 80003, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 1, 10, 0, "", 30, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (225, 0, "キャル", 0, 80003, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 2, 10, 0, "", 40, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (226, 0, "ペコリーヌ", 0, 80003, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 10, 0, "", 33, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (227, 0, "キャル", 0, 80003, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 2, 10, 0, "", 41, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (228, 0, "ペコリーヌ", 0, 80003, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 10, 0, "", 34, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (229, 0, "ペコリーヌ", 0, 80003, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 10, 0, "", 35, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (230, 0, "キャル", 0, 80003, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 2, 10, 0, "", 42, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (231, 0, "コッコロ", 0, 80003, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 1, 10, 0, "", 31, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (232, 0, "キャル", 0, 80003, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 2, 10, 0, "", 43, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (233, 0, "ペコリーヌ", 0, 80003, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 10, 0, "", 36, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (234, 0, "カリン", 0, 80003, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 11, 0, "", 6, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (235, 0, "カリン", 0, 80003, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 11, 0, "", 7, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (236, 0, "カリン", 0, 80003, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 11, 0, "", 8, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (237, 0, "カリン", 0, 80003, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 11, 0, "", 9, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (238, 0, "カリン", 0, 80003, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 11, 0, "", 10, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (239, 0, "カリン", 0, 80003, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 11, 0, "", 11, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (240, 0, "カリン", 0, 80003, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 11, 0, "", 12, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (241, 0, "カリン", 0, 80003, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 11, 0, "", 13, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (242, 0, "カリン", 0, 80003, "あれ？\nもしかして緊張で気を失って…？", 0, 11, 0, "", 14, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (243, 0, "カリン", 0, 80003, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 11, 0, "", 15, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (244, 0, "カリン", 0, 80003, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 11, 0, "", 16, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (245, 0, "カリン", 0, 80003, "それでは\nまた明日お会いしましょう♪", 0, 11, 0, "", 17, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (246, 0, "キャル", 0, 80003, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 12, 0, "", 44, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (247, 0, "ペコリーヌ", 0, 80003, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 2, 12, 0, "", 37, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (248, 0, "コッコロ", 0, 80003, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 1, 12, 0, "", 32, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (249, 0, "キャル", 0, 80003, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 12, 0, "", 45, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (250, 0, "ペコリーヌ", 0, 80003, "ひどいですよぉキャルちゃ～ん！", 2, 12, 0, "", 38, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (251, 0, "コッコロ", 0, 80003, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 1, 12, 0, "", 33, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (252, 0, "ペコリーヌ", 0, 80003, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 2, 12, 0, "", 39, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (253, 0, "キャル", 0, 80003, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 12, 0, "", 46, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (254, 0, "コッコロ", 0, 80003, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 1, 12, 0, "", 34, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (255, 0, "ペコリーヌ", 0, 80003, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 2, 12, 0, "", 40, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (256, 0, "ペコリーヌ", 0, 80003, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 13, 0, "", 41, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (257, 0, "キャル", 0, 80003, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 2, 13, 0, "", 47, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (258, 0, "ペコリーヌ", 0, 80003, "忘れてきちゃいました☆", 0, 13, 0, "", 42, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (259, 0, "キャル", 0, 80003, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 2, 13, 0, "", 48, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (260, 0, "コッコロ", 0, 80003, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 1, 13, 0, "", 35, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (261, 0, "キャル", 0, 80003, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 2, 13, 0, "", 49, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (262, 0, "ペコリーヌ", 0, 80003, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 13, 0, "", 43, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (263, 0, "キャル", 0, 80003, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 2, 13, 0, "", 50, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (264, 0, "コッコロ", 0, 80003, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 1, 13, 0, "", 36, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (265, 0, "キャル", 0, 80003, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 2, 13, 0, "", 51, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (266, 0, "コッコロ", 0, 80003, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 1, 13, 0, "", 37, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (267, 0, "キャル", 0, 80003, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 2, 13, 0, "", 52, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (268, 0, "ペコリーヌ", 0, 80003, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 13, 0, "", 44, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (269, 0, "コッコロ", 0, 80003, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 1, 13, 0, "", 38, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (270, 0, "ペコリーヌ", 0, 80003, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 13, 0, "", 45, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (271, 0, "キャル", 0, 80003, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 2, 13, 0, "", 53, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (272, 0, "ペコリーヌ", 0, 80003, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 13, 0, "", 46, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (273, 0, "カリン", 0, 80003, "こんにちは\n【ギルド管理協会】のカリンです", 0, 14, 0, "", 18, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (274, 0, "カリン", 0, 80003, "昨日の生放送は\nいかがだったでしょうか？", 0, 14, 0, "", 19, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (275, 0, "カリン", 0, 80003, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 14, 0, "", 20, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (276, 0, "カリン", 0, 80003, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 14, 0, "", 21, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (277, 0, "カリン", 0, 80003, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 14, 0, "", 22, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (278, 0, "カリン", 0, 80003, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 14, 0, "", 23, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (279, 0, "カリン", 0, 80003, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 14, 0, "", 24, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (280, 0, "カリン", 0, 80003, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 14, 0, "", 25, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (281, 0, "カリン", 0, 80003, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 14, 0, "", 26, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (282, 0, "カリン", 0, 80003, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 14, 0, "", 27, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (283, 0, "ペコリーヌ", 0, 80003, "準備はいいですかっ？\n…いっきますよー！", 0, 15, 0, "", 47, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (284, 0, "キャル", 0, 80003, "祝！", 2, 15, 0, "", 54, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (285, 0, "コッコロ", 0, 80003, "2.5周年！", 1, 15, 0, "", 39, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (286, 0, "ペコリーヌ", 0, 80003, "おめでとうございま～す☆", 0, 15, 0, "", 48, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (287, 0, "キャル", 0, 80003, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 2, 15, 0, "", 55, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (288, 0, "コッコロ", 0, 80003, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 1, 15, 0, "", 40, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (289, 0, "ペコリーヌ", 0, 80003, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 15, 0, "", 49, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (290, 0, "キャル", 0, 80003, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 2, 15, 0, "", 56, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (291, 0, "コッコロ", 0, 80003, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 1, 15, 0, "", 41, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (292, 0, "キャル", 0, 80003, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 2, 15, 0, "", 57, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (293, 0, "ペコリーヌ", 0, 80003, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 15, 0, "", 50, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (294, 0, "キャル", 0, 80003, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 2, 15, 0, "", 58, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (295, 0, "ペコリーヌ", 0, 80003, "記念日だから\n平気平気♪\nやばいですね☆", 0, 15, 0, "", 51, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (296, 0, "キャル", 0, 80003, "意味分かんないわよ！", 2, 15, 0, "", 59, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (297, 0, "コッコロ", 0, 80003, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 1, 15, 0, "", 42, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (298, 0, "コッコロ", 0, 80003, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 1, 15, 0, "", 43, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (299, 0, "ペコリーヌ", 0, 80003, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 15, 0, "", 52, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (300, 0, "キャル", 0, 80003, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 2, 15, 0, "", 60, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (301, 0, "コッコロ", 0, 80003, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 1, 15, 0, "", 44, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (302, 0, "ペコリーヌ", 0, 80003, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 15, 0, "", 53, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (303, 0, "ペコリーヌ・コッコロ・キャル", 0, 80003, "2.5周年\nありがとうございます！", 0, 15, 1, "105901,45,106001,61", 54, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (304, 0, "カリン", 1, 60002, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 1, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (305, 1, "", 1, 60002, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (306, 1, "", 1, 60002, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (307, 1, "", 1, 60002, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (308, 1, "", 1, 60002, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (309, 1, "", 2, 60002, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (310, 2, "", 1, 60002, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (311, 2, "", 1, 60002, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (312, 2, "", 1, 60002, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (313, 2, "", 1, 60002, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (314, 2, "", 2, 60002, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (315, 3, "", 1, 60002, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (316, 3, "", 1, 60002, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (317, 3, "", 1, 60002, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (318, 3, "", 1, 60002, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (319, 3, "", 1, 60002, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (320, 3, "", 1, 60002, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (321, 3, "", 2, 60002, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (322, 4, "", 1, 60002, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (323, 4, "", 1, 60002, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (324, 4, "", 1, 60002, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (325, 4, "", 1, 60002, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (326, 4, "", 1, 60002, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (327, 4, "", 1, 60002, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (328, 4, "", 2, 60002, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (329, 0, "カリン", 0, 60002, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 0, "", 2, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (330, 0, "カリン", 0, 60002, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, 0, "", 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (331, 0, "コッコロ", 0, 80005, "ささ、シェフィさまはこちらへ…", 4, 1, 0, "", 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (332, 0, "シェフィ", 0, 80005, "コッコロさん、どこへ行くの…？\n…え？", 0, 1, 0, "", 1, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (333, 0, "ペコリーヌ", 0, 80005, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 3, 1, 0, "", 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (334, 0, "コッコロ", 0, 80005, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 4, 1, 0, "", 2, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (335, 0, "シェフィ", 0, 80005, "ええと…\n二人とも何をしているの？", 0, 1, 0, "", 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (336, 0, "キャル", 0, 80005, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 1, 0, "", 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (337, 0, "シェフィ", 0, 80005, "あの日…？", 0, 1, 0, "", 3, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (338, 0, "ペコリーヌ", 0, 80005, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 3, 1, 0, "", 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (339, 0, "ペコリーヌ", 0, 80005, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 1, 0, "", 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (340, 0, "カリン", 0, 80005, "やばいですね☆", 2, 1, 0, "", 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (341, 0, "キャル", 0, 80005, "って、なにしれっと\n参加してんのよカリン！", 1, 1, 0, "", 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (342, 0, "カリン", 0, 80005, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 1, 0, "", 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (343, 0, "カリン", 0, 80005, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 2, 1, 0, "", 3, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (344, 0, "ペコリーヌ", 0, 80005, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 3, 1, 0, "", 4, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (345, 0, "シェフィ", 0, 80005, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 1, 0, "", 4, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (346, 0, "ペコリーヌ", 0, 80005, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 3, 2, 0, "", 5, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (347, 0, "コッコロ", 0, 80005, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 1, 2, 0, "", 3, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (348, 0, "コッコロ", 0, 80005, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 1, 2, 0, "", 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (349, 0, "ペコリーヌ", 0, 80005, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 3, 2, 0, "", 6, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (350, 0, "コッコロ", 0, 80005, "さすがでございます\nペコリーヌさま", 1, 2, 0, "", 5, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (351, 0, "キャル", 0, 80005, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 2, 0, "", 3, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (352, 0, "シェフィ", 0, 80005, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 2, 0, "", 5, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (353, 0, "ペコリーヌ", 0, 80005, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 3, 2, 0, "", 7, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (354, 0, "コッコロ", 0, 80005, "さ、次はキャルさまの\n番でございますよ", 1, 2, 0, "", 6, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (355, 0, "キャル", 0, 80005, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 2, 0, "", 4, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (356, 0, "シェフィ", 0, 80005, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 2, 0, "", 6, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (357, 0, "キャル", 0, 80005, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 2, 0, "", 5, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (358, 0, "キャル", 0, 80005, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 2, 0, "", 6, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (359, 0, "コッコロ", 0, 80005, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 1, 2, 0, "", 7, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (360, 0, "キャル", 0, 80005, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 2, 0, "", 7, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (361, 0, "コッコロ", 0, 80005, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 1, 3, 0, "", 8, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (362, 0, "ペコリーヌ", 0, 80005, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 3, 0, "", 8, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (363, 0, "コッコロ", 0, 80005, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 1, 3, 0, "", 9, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (364, 0, "シェフィ", 0, 80005, "聖学祭…って、なにかしら？", 2, 3, 0, "", 7, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (365, 0, "コッコロ", 0, 80005, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 1, 3, 0, "", 10, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (366, 0, "キャル", 0, 80005, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 3, 0, "", 8, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (367, 0, "キャル", 0, 80005, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 3, 0, "", 9, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (368, 0, "ペコリーヌ", 0, 80005, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 3, 0, "", 9, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (369, 0, "キャル", 0, 80005, "いや、そのまんますぎでしょ…", 0, 3, 0, "", 10, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (370, 0, "シェフィ", 0, 80005, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 2, 3, 0, "", 8, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (371, 0, "ペコリーヌ", 0, 80005, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 3, 0, "", 10, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (372, 0, "シェフィ", 0, 80005, "えっ？　ええ…\nぎゅーっ…？", 2, 3, 0, "", 9, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (373, 0, "キャル", 0, 80005, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 4, 0, "", 11, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (374, 0, "シェフィ", 0, 80005, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 2, 4, 0, "", 10, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (375, 0, "キャル", 0, 80005, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 4, 0, "", 12, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (376, 0, "コッコロ", 0, 80005, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 1, 4, 0, "", 11, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (377, 0, "キャル", 0, 80005, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 4, 0, "", 13, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (378, 0, "ペコリーヌ", 0, 80005, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 3, 4, 0, "", 11, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (379, 0, "キャル", 0, 80005, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 4, 0, "", 14, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (380, 0, "キャル", 0, 80005, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 4, 0, "", 15, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (381, 0, "シェフィ", 0, 80005, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 2, 4, 0, "", 11, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (382, 0, "ペコリーヌ", 0, 80005, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 3, 4, 0, "", 12, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (383, 0, "コッコロ", 0, 80005, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 1, 4, 0, "", 12, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (384, 0, "キャル", 0, 80005, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 4, 0, "", 16, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (385, 0, "シェフィ", 0, 80005, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 2, 4, 0, "", 12, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (386, 0, "ペコリーヌ", 0, 80005, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 3, 5, 0, "", 13, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (387, 0, "ペコリーヌ", 0, 80005, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 3, 5, 0, "", 14, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (388, 0, "ペコリーヌ", 0, 80005, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 3, 5, 0, "", 15, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (389, 0, "キャル", 0, 80005, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 5, 0, "", 17, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (390, 0, "キャル", 0, 80005, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 5, 0, "", 18, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (391, 0, "シェフィ", 0, 80005, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 2, 5, 0, "", 13, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (392, 0, "コッコロ", 0, 80005, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 1, 5, 0, "", 13, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (393, 0, "ペコリーヌ", 0, 80005, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 3, 5, 0, "", 16, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (394, 0, "キャル", 0, 80005, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 5, 0, "", 19, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (395, 0, "ペコリーヌ", 0, 80005, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 3, 5, 0, "", 17, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (396, 0, "ペコリーヌ", 0, 80005, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 3, 5, 0, "", 18, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (397, 0, "ペコリーヌ", 0, 80005, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 3, 5, 0, "", 19, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (398, 0, "カリン", 0, 80005, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 2, 6, 0, "", 4, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (399, 0, "カリン", 0, 80005, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 2, 6, 0, "", 5, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (400, 0, "キャル", 0, 80005, "…えっ！？", 1, 6, 0, "", 20, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (401, 0, "ペコリーヌ", 0, 80005, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 3, 6, 0, "", 20, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (402, 0, "シェフィ", 0, 80005, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 6, 0, "", 14, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (403, 0, "コッコロ", 0, 80005, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 4, 6, 0, "", 14, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (404, 0, "シェフィ", 0, 80005, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 6, 0, "", 15, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (405, 0, "キャル", 0, 80005, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 1, 6, 0, "", 21, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (406, 0, "ペコリーヌ", 0, 80005, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 3, 6, 0, "", 21, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (407, 0, "キャル", 0, 80005, "ぶっ殺すぞ！？", 1, 6, 0, "", 22, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (408, 0, "カリン", 0, 80005, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 2, 6, 0, "", 6, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (409, 0, "コッコロ", 0, 80005, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 1, 7, 0, "", 15, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (410, 0, "キャル", 0, 80005, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 7, 0, "", 23, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (411, 0, "シェフィ", 0, 80005, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 2, 7, 0, "", 16, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (412, 0, "ペコリーヌ", 0, 80005, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 3, 7, 0, "", 22, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (413, 0, "キャル", 0, 80005, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 7, 0, "", 24, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (414, 0, "シェフィ", 0, 80005, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 2, 7, 0, "", 17, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (415, 0, "コッコロ", 0, 80005, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 1, 7, 0, "", 16, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (416, 0, "シェフィ", 0, 80005, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 2, 7, 0, "", 18, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (417, 0, "コッコロ", 0, 80005, "もちろんでございます\n仲良くお勉強いたしましょう", 1, 7, 0, "", 17, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (418, 0, "キャル", 0, 80005, "しれっと教育ママが\n生まれてる…？", 0, 7, 0, "", 25, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (419, 0, "ペコリーヌ", 0, 80005, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 3, 7, 0, "", 23, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (420, 0, "キャル", 0, 80005, "え～～～～！？", 0, 7, 0, "", 26, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (421, 0, "キャル", 0, 80005, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 8, 0, "", 27, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (422, 0, "シェフィ", 0, 80005, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 2, 8, 0, "", 19, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (423, 0, "コッコロ", 0, 80005, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 1, 8, 0, "", 18, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (424, 0, "ペコリーヌ", 0, 80005, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 3, 8, 0, "", 24, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (425, 0, "シェフィ", 0, 80005, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 2, 8, 0, "", 20, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (426, 0, "キャル", 0, 80005, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 8, 0, "", 28, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (427, 0, "コッコロ", 0, 80005, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 1, 8, 0, "", 19, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (428, 0, "シェフィ", 0, 80005, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 2, 8, 0, "", 21, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (429, 0, "キャル", 0, 80005, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 8, 0, "", 29, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (430, 0, "キャル", 0, 80005, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 8, 0, "", 30, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (431, 0, "ペコリーヌ", 0, 80005, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 3, 8, 0, "", 25, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (432, 0, "キャル", 0, 80005, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 8, 0, "", 31, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (433, 0, "シェフィ", 0, 80005, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 9, 0, "", 22, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (434, 0, "シェフィ", 0, 80005, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 9, 0, "", 23, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (435, 0, "シェフィ", 0, 80005, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 9, 0, "", 24, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (436, 0, "シェフィ", 0, 80005, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 9, 0, "", 25, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (437, 0, "シェフィ", 0, 80005, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 9, 0, "", 26, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (438, 0, "シェフィ", 0, 80005, "それから、それから…！\nぅ、ぅぅっ…！", 0, 9, 0, "", 27, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (439, 0, "シェフィ", 0, 80005, "―びえぇぇ～んっ！！！", 0, 9, 0, "", 28, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (440, 0, "コッコロ", 0, 80005, "どうされましたか、シェフィさま", 1, 9, 0, "", 20, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (441, 0, "シェフィ", 0, 80005, "ううっ…ひっく…\nママッ…！", 0, 9, 0, "", 29, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (442, 0, "コッコロ", 0, 80005, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 1, 9, 0, "", 21, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (443, 0, "コッコロ", 0, 80005, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 1, 9, 0, "", 22, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (444, 0, "シェフィ", 0, 80005, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 9, 0, "", 30, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (445, 0, "コッコロ", 0, 80005, "主さま\n3.5周年まであと５日\nでございます", 0, 10, 0, "", 23, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (446, 0, "コッコロ", 0, 80005, "ですがその前に\n生放送がありますね", 0, 10, 0, "", 24, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (447, 0, "コッコロ", 0, 80005, "…生放送に向けた\n意気込みでございますか？", 0, 10, 0, "", 25, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (448, 0, "コッコロ", 0, 80005, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 10, 0, "", 26, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (449, 0, "コッコロ", 0, 80005, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 10, 0, "", 27, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (450, 0, "コッコロ", 0, 80005, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 10, 0, "", 28, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (451, 0, "コッコロ", 0, 80005, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 10, 0, "", 29, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (452, 0, "コッコロ", 0, 80005, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 10, 0, "", 30, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (453, 0, "コッコロ", 0, 80005, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 10, 0, "", 31, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (454, 0, "ペコリーヌ", 0, 80005, "3.5周年まであと４日！\nやばいですね☆", 0, 11, 0, "", 26, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (455, 0, "キャル", 0, 80005, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 1, 11, 0, "", 32, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (456, 0, "ペコリーヌ", 0, 80005, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 11, 0, "", 27, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (457, 0, "ペコリーヌ", 0, 80005, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 11, 0, "", 28, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (458, 0, "ペコリーヌ", 0, 80005, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 11, 0, "", 29, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (459, 0, "キャル", 0, 80005, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 1, 11, 0, "", 33, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (460, 0, "ペコリーヌ", 0, 80005, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 11, 0, "", 30, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (461, 0, "ペコリーヌ", 0, 80005, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 11, 0, "", 31, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (462, 0, "ペコリーヌ", 0, 80005, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 11, 0, "", 32, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (463, 0, "キャル", 0, 80005, "だからあたしはやるなんて一言も…", 1, 11, 0, "", 34, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (464, 0, "ペコリーヌ", 0, 80005, "オイッスー☆", 0, 11, 0, "", 33, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (465, 0, "キャル", 0, 80005, "聞きなさいっての！！", 1, 11, 0, "", 35, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (466, 0, "シェフィ", 0, 80005, "3.5周年まであと３日…\nそして生放送は、明日…", 2, 12, 0, "", 31, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (467, 0, "シェフィ", 0, 80005, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 2, 12, 0, "", 32, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (468, 0, "シェフィ", 0, 80005, "おいっす！\n…こうじゃなかったわね\nええと確か…", 2, 12, 0, "", 33, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (469, 0, "シェフィ", 0, 80005, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 2, 12, 0, "", 34, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (470, 0, "シェフィ", 0, 80005, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 2, 12, 0, "", 35, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (471, 0, "ペコリーヌ", 0, 80005, "やってますねシェフィちゃん！", 3, 12, 0, "", 34, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (472, 0, "キャル", 0, 80005, "なによ、考えることは\nみんな同じってこと？", 0, 12, 0, "", 36, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (473, 0, "コッコロ", 0, 80005, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 1, 12, 0, "", 32, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (474, 0, "シェフィ", 0, 80005, "みんな…もちろんよ！", 2, 12, 0, "", 36, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (475, 0, "ペコリーヌ", 0, 80005, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 3, 12, 0, "", 35, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (476, 0, "カリン", 0, 80005, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 2, 13, 0, "", 7, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (477, 0, "カリン", 0, 80005, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 2, 13, 0, "", 8, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (478, 0, "ペコリーヌ", 0, 80005, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 3, 13, 0, "", 36, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (479, 0, "カリン", 0, 80005, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 2, 13, 0, "", 9, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (480, 0, "コッコロ", 0, 80005, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 4, 13, 0, "", 33, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (481, 0, "カリン", 0, 80005, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 2, 13, 0, "", 10, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (482, 0, "キャル", 0, 80005, "大丈夫…大丈夫…\nあたしは大丈夫…", 1, 13, 0, "", 37, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (483, 0, "カリン", 0, 80005, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 2, 13, 0, "", 11, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (484, 0, "シェフィ", 0, 80005, "あうー？", 0, 13, 0, "", 37, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (485, 0, "みんな", 0, 80005, "あ…", 4, 13, 1, "105901,34,106001,38,190801,12", 37, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (486, 0, "キャル", 0, 80005, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 1, 13, 0, "", 39, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (487, 0, "コッコロ", 0, 80005, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 4, 13, 0, "", 35, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (488, 0, "ペコリーヌ", 0, 80005, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 3, 13, 0, "", 38, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (489, 0, "カリン", 0, 80005, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 2, 13, 0, "", 13, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (490, 0, "シェフィ", 0, 80005, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 2, 14, 0, "", 38, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (491, 0, "ペコリーヌ", 0, 80005, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 3, 14, 0, "", 39, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (492, 0, "キャル", 0, 80005, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 14, 0, "", 40, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (493, 0, "コッコロ", 0, 80005, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 1, 14, 0, "", 36, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (494, 0, "シェフィ", 0, 80005, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 2, 14, 0, "", 39, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (495, 0, "ペコリーヌ", 0, 80005, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 3, 14, 0, "", 40, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (496, 0, "コッコロ", 0, 80005, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 1, 14, 0, "", 37, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (497, 0, "キャル", 0, 80005, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 14, 0, "", 41, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (498, 0, "シェフィ", 0, 80005, "へ、へぇ…", 2, 14, 0, "", 40, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (499, 0, "ペコリーヌ", 0, 80005, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 3, 14, 0, "", 41, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (500, 0, "シェフィ", 0, 80005, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 2, 14, 0, "", 41, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (501, 0, "シェフィ", 0, 80005, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 2, 14, 0, "", 42, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (502, 0, "ペコリーヌ", 0, 80005, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 3, 15, 0, "", 42, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (503, 0, "キャル", 0, 80005, "祝！", 1, 15, 0, "", 42, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (504, 0, "コッコロ", 0, 80005, "3.5周年！", 4, 15, 0, "", 38, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (505, 0, "シェフィ", 0, 80005, "おめでとうございます！", 0, 15, 0, "", 43, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (506, 0, "カリン", 0, 80005, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 2, 15, 0, "", 14, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (507, 0, "カリン", 0, 80005, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 2, 15, 0, "", 15, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (508, 0, "ペコリーヌ", 0, 80005, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 3, 15, 0, "", 43, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (509, 0, "ペコリーヌ", 0, 80005, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 3, 15, 0, "", 44, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (510, 0, "キャル", 0, 80005, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 1, 15, 0, "", 43, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (511, 0, "キャル", 0, 80005, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 1, 15, 0, "", 44, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (512, 0, "シェフィ", 0, 80005, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 15, 0, "", 44, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (513, 0, "シェフィ", 0, 80005, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 15, 0, "", 45, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (514, 0, "コッコロ", 0, 80005, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 4, 15, 0, "", 39, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (515, 0, "コッコロ", 0, 80005, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 4, 15, 0, "", 40, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (516, 0, "コッコロ", 0, 80005, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 4, 15, 0, "", 41, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (517, 0, "ペコリーヌ", 0, 80005, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 3, 15, 0, "", 45, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (518, 0, "みんな", 0, 80005, "これからも\nよろしくおねがいします！", 4, 15, 1, "105901,42,106001,45,106401,46,190801,16", 46, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (519, 0, "カリン", 1, 60003, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 1, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (520, 1, "", 1, 60003, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (521, 1, "", 1, 60003, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (522, 1, "", 1, 60003, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (523, 1, "", 1, 60003, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (524, 1, "", 2, 60003, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (525, 2, "", 1, 60003, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (526, 2, "", 1, 60003, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (527, 2, "", 1, 60003, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (528, 2, "", 1, 60003, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (529, 2, "", 2, 60003, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (530, 3, "", 1, 60003, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (531, 3, "", 1, 60003, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (532, 3, "", 1, 60003, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (533, 3, "", 1, 60003, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (534, 3, "", 1, 60003, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (535, 3, "", 1, 60003, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (536, 3, "", 2, 60003, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (537, 4, "", 1, 60003, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (538, 4, "", 1, 60003, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (539, 4, "", 1, 60003, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 0, 0, "", 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (540, 4, "", 1, 60003, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 2, 0, 0, "", 0, 0);
